	private static int DIMENSIONE_MAX = 51000000;
	
	public void service(AbstractPplProcess process, IRequestWrapper request) {
		try {
			if (initialise(request)) {
				ProcessData dataForm = (ProcessData) process.getData();
				dataForm.setMessaggioErrore("");
				//List p_attachements = new ArrayList<>();
				List p_attachements = new ArrayList<Object>();
				String identificativoPratica = dataForm.getDettaglioPratica().getProcessDataID();
				String nomefile = (String)request.getParameter("fileName");
				MyPageDAO delegate = new MyPageDAO();
				if (!dataForm.getAllegati().isEmpty()) {
					Attachment allegato = (Attachment) dataForm.getAllegati().get(0);
					if (allegato != null) {
						String[] temp = allegato.getName().split("\\.");
						ManagerAllegati m = new ManagerAllegati();
						if (temp[temp.length - 1].equalsIgnoreCase("p7m")) {
							//if (temp[temp.length - 1].equalsIgnoreCase("p7m") || m.checkSignedPDF(allegato)) {	
							if (allegato.getFileLenght() < DIMENSIONE_MAX) {
								delegate.saveAllegatoInterop(process, request);
								dataForm.setAllegati(p_attachements);
								goToStep(process, request, 0);
							} else {
								dataForm.setMessaggioErrore("Errore - Dimensione file maggiore di 50 MB");
								dataForm.setAllegati(p_attachements);
							}
						} else {
							dataForm.setMessaggioErrore("Errore - File allegato non firmato");
							dataForm.setAllegati(p_attachements);
						}
					}
				}
				else {
					List<TipologiaEventoIntegrazione> listaTipologiaEventi = delegate.getTipologiaEventi(process, request);
					dataForm.setListaTipologiaEventi(listaTipologiaEventi);
					String flag = (String)request.getParameter("uploadName");
					if(flag !=null && flag.trim().length() == 0) {
						Evento inviaEventoIntegrazione = inviaEventoIntegrazione(request,identificativoPratica,process);
						if(inviaEventoIntegrazione.getIdEvento() !=null && inviaEventoIntegrazione.getIdEvento() > 0)
							goToStep(process, request, -1);
						else
							dataForm.setMessaggioErrore("Errore nell'invio della comunicazione / integrazione");
						
					}
					List<Attachment> allegatiSalvati = delegate.getElencoAllegati(process,request);
					dataForm.setAllegatiSalvati(allegatiSalvati);
				}
				
			} else {
				throw new MyPageException("Sessione scaduta");
			}
			logger.debug("AllegaInterStep - service method END");
		} catch (Exception e){
			gestioneEccezioni(process,0,e);
		}
	}
	
